import React from 'react';
import './App.css';
const App = () => {
  blognone => {
    fetch(
      "https://jobs-api.blognone.com/search?q=Digital+Marketing&page=1&type=FULL_TIME,INTERNSHIP&func=DEVELOPER"
    ).then(response => {
      if (response.ok) {
        return response.json();
      } else {
        throw new Error("Something went wrong ...");
      }
    });
  };
  return (
    <div className="App">
      <Autocomplete
        options={[
          "Papaya",
          "Persimmon",
          "Paw Paw",
          "Prickly Pear",
          "Peach",
          "Pomegranate",
          "Pineapple"
        ]}
      />
    </div>
  );
};
export default App;
